module.exports = "<html lang=\"en\">\n<head>\n  <meta charset=\"utf-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"stylesheet\" href=\"https://www.w3schools.com/w3css/4/w3.css\"> \n  <link rel=\"stylesheet\" href=\"https://fonts.googleapis.com/css?family=Raleway\">\n  <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\">\n  <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>\n  <input rel=\"stylesheet\" href=\"css/style.css\">\n</head>\n\n<div class=\"container-fluit\">\n    <div  style=\"background-image:url('assets/images/pexels-photo-9554478.jpg '); height:600px; \">\n        <div class=\"w3-animate-right us \">\n            <h1>Business Assurance Testing Service</h1>\n            \n            <p>This is a unique and innovative service offering by ADM which no other organization can offer. \n              We use our proprietary <b>‘Business Essential Software Testing (BEST)</b> \n              Framework’ to bring upon a multi fold improvement in product quality.</p>\n        </div>\n    </div>\n    <div class=\"business\"  >\n        <p>\n            ADM proposes this unique methodology which will enhance the quality of QA Delivery in multiple ways. The idea here is to perform an extensive Business or Customer focused testing instead of just functional testing during the testing phase.\n        </p>\n        <p>\n            ADM will ensure this by having a tight coupling between the BA & the QA Team. \n            In fact, BAs would be very much a part of the QA Team and drive what we call ‘Business Assurance’ testing. With this new innovative methodology, \n            ADM intends to expand the scope of BA activities to cover the entire STLC.\n        </p>\n\n    </div>\n\n      <div class=\"w3-row content\">\n            <h1>Benefits of ADM’s Business Analysis & Requirement Engineering Service</h1>\n            <div class=\"w3-half  inner\">   \n                <ul style=\"list-style-type:circle;\">\n                    <li>Due Diligence and Solution Outline creates a foundation for further requirement elicitation and documentation</li>\n                  <li>Requirement workshop with joint working group consisting of end users and ADM BAs</li>\n                  <li>Requirement elicitation, analysis, documentation and management of requirements</li>\n                  <li>Through requirement documentation eliminates the risk of missing requirements</li>\n                  <li>Process standardization by using proper templates for requirement engineering</li>\n                </ul> \n            </div> \n            <div class=\"w3-half inner\">\n                <ul style=\"list-style-type:circle;\">\n                  <li>Early Defect Detection to reduce defect fixing cost</li>\n                  <li>BA Team’s involvement across STLC & SDLC</li>\n                  <li>Inclusion of unique Pre-UAT Phase in STLC, driven by ADM BA Team</li>\n                  <li>Domain experts on team</li>\n                  <li>QA-BA Pair Testing ensures business acceptance criteria are met</li>\n                </ul> \n            </div>\n      </div>\n\n        <div class=\"w3-lime outside\" style=\"background-image:url('assets/images/pexels-photo-590041.jpg '); height: 630px; \">\n            <h1>ADM On- Demand Business Assurance Testing Process</h1>\n            <div class=\"w3-third w3-pale-blue inside\"> \n              <h2>Input</h2>\n              <ul class=\"order\">\n                  <li>Project Due Diligence sessions</li>\n                  <li>Project Time Line</li>\n                  <li>Requirement Gathering Sessions or Demo Sessions</li>\n                  <li>Business Requirements (If already available)*</li>\n                  <li>Functional Requirements (If already available)*</li>\n                  <li>Architecture Documents</li>\n                  <li>Sample Test Documents</li>\n              </ul> \n              <p>* If Business & Functional Requirements aren’t available, our BA Team will create them based on the Requirement Gathering & Demo Sessions. \n                The BA Team will work on further enhancing the Business & Functional Requirements if already available</p>\n            </div>\n            <div class=\"w3-third w3-sand inside\">\n              <h2>Experienced BA Professionals</h2>\n                <ul class=\"order\">\n                  <li>Quick Ramp up</li>\n                  <li>Optimum use of time, money and high quality</li>\n                  <li>Domain Experts </li>\n                </ul> \n            </div>\n            <div class=\"w3-third w3-pale-yellow inside\">\n              <H2>Output</H2>\n                <ul class=\"order\">\n                  <li>Solution Document</li>\n                  <li>Business Requirements</li>\n                  <li>Functional Requirements</li>\n                  <li>User Stories/ Use Cases</li>\n                  <li>Requirement Traceability Matrix</li>\n                  <li>Test Cases</li>\n                  <li>Test Plan & Scenarios</li>\n                  <li>Business Assurance Testing Status Report with Metrics</li>\n                </ul> \n            </div>\n        </div>\n\n        <div class=\" about\">\n            <H2>How it Works</H2>\n            <ul class=\"order\">\n              <li>Together, we outline requirements and expectations</li>\n              <li>Our team reviews this information and creates a solution document</li>\n              <li>We provide an estimation of effort (including time and # of resources)</li>\n              <li>The team is assembled and work begins</li>\n            </ul> \n        </div>\n\n      <div class=\"deliver\"  >\n          <h1>Common Deliverables</h1>\n            <ul class=\"order\" class=\"w3-half\">\n                  <li>Solution Outline Document</li>\n                  <li>Business Requirement Document</li>\n                  <li>Functional Requirement Document</li>\n                  <li>User Stories/ Use Cases</li>\n                  <li>Wireframes & Data Flow Diagrams</li>\n                  <li>Acceptance Criteria</li>\n            </ul>\n            <ul class=\"order\" class=\"w3-half\">\n                    <li>High Level Test Cases</li>\n                    <li>Detailed Test Cases</li>\n                    <li>Positive Test Cases</li>\n                    <li>Negative Test Cases</li>\n                    <li>Health Check Status</li>\n                    <li>Prioritization of the test cases based on importance</li>\n            </ul>\n      </div>\n    </div>\n\n</html>"

