module.exports = "<html lang=\"en\">\n<head>\n  <meta charset=\"utf-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"stylesheet\" href=\"https://www.w3schools.com/w3css/4/w3.css\"> \n  <link rel=\"stylesheet\" href=\"https://fonts.googleapis.com/css?family=Raleway\">\n  <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\">\n  <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>\n  <input rel=\"stylesheet\" href=\"css/style.css\">\n</head>\n\n\n  <div class=\"container-fluit\">\n    <div style=\"background-image:url('assets/images/qa procs 5.jpg '); height:600px; \">\n        <div class=\"w3-animate-right us \">\n            <h1><i class=\"fa fa-address-card-o\" aria-hidden=\"true\"></i> QA Process & Maturity Assessment</h1>\n            \n            <p>Daily, our specialized BA recruiters talk with new and existing candidates to understand their specific skillsets, experience, \n              and personalities so that we can more accurately find a synergistic candidate.</p>\n        </div>\n    </div>\n        <div class=\"w3-row about\">\n            <div class=\"w3-third one\">\n                <p></p>\n            </div>\n            <div class=\"w3-third two\">\n                <p>\n                    Noticeably, the longer the errors survive through the development process the cost of errors increases exponentially. \n                    It is important to find the inefficiencies in the system right from the test planning phase minimizing the extra costs. \n                    We thoroughly assess our processes to make sure that the QA processes and delivery proficiencies are accessible, well organized and agile.\n                </p>\n                <p>\n                    Possible modifications are proposed to organize the QA process in the best possible way that includes:\n                </p>\n                <ul>\n                  <li>Proposing a roadmap stating main purposes and responsibilities.</li>\n                  <li>Identifying the cost and time estimations.</li>\n                  <li>Estimation of tools, people, and process.</li>\n                  <li>Defining the improvement areas along with the approach to execute the same.</li>\n                </ul>\n            </div>\n            <div class=\"w3-third three\">\n                <img src=\"assets/images/mobile glass notes .jpg \"   >\n            </div>\n            \n        </div>\n\n        <div class=\"w3-row abt\">\n            <div class=\"w3-third ccc\">\n                <img src=\"assets/images/qulity.jpg \"   >\n            </div>\n            <div class=\"w3-third aaa\">\n                <p></p>\n            </div>\n            <div class=\"w3-third bbb\">\n                <p>\n                    To improve the overall quality of the application, after evaluating the limitations of an organization’s \n                    QA processes a roadmap is proposed considering the business objectives. \n                    This process helps in improving the quality, speeds up the delivery time, increased productivity.\n                    We evaluate the process and recommend the improvements to assure the quality of the product that \n                    we deliver. BugRaptors’ Maturity assessment process identifies the areas that need improvement. The QA & Maturity assessment process that we follow includes well-organized test processes that lead to the discovery of process related issues at a very early stage. It also handles time, cost and quality constraints.\n                </p>\n        \n            </div>\n            \n        </div>\n  </div>\n\n</html>"

