module.exports = "<html lang=\"en\">\n<head>\n  <meta charset=\"utf-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n  <link rel=\"stylesheet\" href=\"https://www.w3schools.com/w3css/4/w3.css\"> \n  <link rel=\"stylesheet\" href=\"https://fonts.googleapis.com/css?family=Raleway\">\n  <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\">\n  <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>\n  <input rel=\"stylesheet\" href=\"css/style.css\">\n</head>\n\n<div class=\"container-fluit\">\n    <div  style=\"background-image:url('assets/images/security 7.jpg '); height:600px; \">\n        <div class=\"w3-animate-right us \">\n            <h1>Security Testing Services</h1>\n            \n            <p>Security testing can be daunting. \n              It requires dedicated training, ongoing education, continuous practice, and top rated tools.</p>\n        </div>\n    </div>\n        <div class=\" about\">\n            <p>\n                We live in an online world, and one that is under an ever increasing threat of malicious individuals whose sole purpose is to find weaknesses in web or mobile applications and exploit them for their own gain.  The majority of web and mobile applications submitted for security verification do not pass the first time. Even a small breach could cost your company millions in lost business, loss of trust, and lawsuits. \n                A large breach could bring a company to its knees. But you don’t need to face the threat alone.\n            </p>\n        </div>\n\n      <div class=\"w3-row content\">\n            <h1>Understanding the Threat</h1>\n            <div class=\"w3-half  inner\">   \n                <ul style=\"list-style-type:circle;\">\n                    <li>DOS </li>\n                        <p>These attacks focus on bringing your system to a full halt and preventing your users from accessing it.</p>\n                    <li>Injection</li>\n                        <p>This type of attack uses common data or form fields to access your full database.</p>\n                    <li>Authentication</li>\n                        <p>Attackers can use this attack to exploit passwords, keys, or tokens to gain admin level access.</p>\n                    <li>Cross Site Scripting or XSS</li>\n                        <p>Attackers can use this to execute scripts to hijack user sessions, redirect users to sites with malicious code, or deface your website.</p>\n                </ul> \n            </div> \n            <div class=\"w3-half inner\">\n                <ul style=\"list-style-type:circle;\">\n                    <li>Privilege Exploits</li>\n                        <p>If frameworks and libraries aren’t properly secured, they can be exploited to gain unauthorized access to the system.</p>\n                    <li>Functions</li>\n                        <p>Unsecured server functions can be exploited to damage your system.</p>\n                    <li>Direct Objects</li>\n                        <p>Direct references to objects are easy ways for attackers to gain access to all of your sensitive data.</p>\n                </ul> \n            </div>\n      </div>\n\n        <div class=\"w3-lime outside\" style=\"background-image:url('assets/images/transaction.jpg '); height: 700px; \">\n            <h1>Free Website Testing Services</h1>\n            <div class=\"w3-third inside\"> \n              <h2><i class=\"fa fa-check fa-2x\" aria-hidden=\"true\"></i>BEST PRACTICES</h2>\n              <ul class=\"order\">\n                  <li>Based on OWASP Guidelines</li>\n                  <li>Security Testing throughout SDLC</li>\n                  <li>Threat Modeling & Threat Rating</li>\n                  <li>Industry Standards</li>\n                  <li>Metrics, PKIs & Reports</li>\n              </ul> \n            </div>\n            <div class=\"w3-third inside\">\n              <h2><i class=\"fa fa-shield fa-2x\" aria-hidden=\"true\"></i> OUR SECURITY TESTING FACETS</h2>\n                <ul start=\"5\" class=\"order\">\n                  <li>Security Hardening</li>\n                  <li>Patch Management</li>\n                  <li>Identity Management</li>\n                  <li>Ongoing Monitoring</li>\n                  <li>Functional Security Testing</li>\n                  <li>Preventive & Proactive approach</li>\n                </ul> \n            </div>\n            <div class=\"w3-third inside\">\n              <H2><i class=\"fa fa-cogs fa-2x\"></i> TOP RATED TOOLS</H2>\n                <ul class=\"order\">\n                  <li>ZAP</li>\n                  <li>SQL Inject Me</li>\n                  <li>OpenVAS</li>\n                  <li>HTTP Watch</li>\n                  <li>HP Weblnspect</li>\n                  <li>NetCraft</li>\n                  <li>App Scanner</li>\n                </ul> \n            </div>\n\n            <div class=\"w3-row service\">\n                <h1>Security Threats</h1>\n                <div class=\"w3-quarter verify\">  \n                    <ul style=\"list-style-type:none;\">\n                        <li><i class=\"fa fa-globe\" aria-hidden=\"true\"></i> Denial of Service </li>\n                        <li>Injection Flaws</li>\n                    </ul>\n                </div>\n                <div class=\"w3-quarter verify\">  \n                    <ul style=\"list-style-type:none;\">\n                        <li> Cross Site Scripting </li>\n                        <li>Broken Access Control</li>\n                    </ul>\n                </div>\n                <div class=\"w3-quarter verify\">  \n                    <ul style=\"list-style-type:none;\">\n                        <li> Improper Error Handling </li>\n                        <li>Insecure Storage</li>\n                    </ul>\n                </div>\n                <div class=\"w3-quarter verify\">  \n                    <ul style=\"list-style-type:none;\">\n                        <li> Broken Session Mgmt </li>\n                        <li>Buffer Overflows</li>\n                    </ul>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"well\">\n            <h1>Why ADM</h1>\n            <ul class=\"order\">\n                  <li>Specialized security testing services executed by dedicated professionals</li>\n                  <li>Examines your application the same way a hacker would</li>\n                  <li>Proficient in aggressively attacking application defenses to find loopholes and weaknesses</li>\n                  <li>Use top rated tools</li>\n                  <li>Abide by best practices set forth by OWASP</li>\n            </ul> \n        </div>\n        \n        <div class=\"list\">\n          <h1>Some Facets of our Security Testing Services</h1>\n            <div class=\"w3-row\">\n              <div class=\"w3-third point\">\n                  <h2>Security Hardening </h2>\n                  <p>Helps to configure your system above and beyond DoD standards by monitoring for and removing any unwanted software and \n                    providing an up-to-date professional analysis of your system’s potential weaknesses.</p>\n              </div>\n              <div class=\"w3-third point\">\n                  <h2>Functional Security Testing</h2>\n                  <p>Our team of security experts will analyze the everyday expectations for the end user, create tests to find \n                    vulnerabilities that could allow DOS attacks, memory leaks, buffer overflows, SQL Injection, and more.</p>\n              </div>\n              <div class=\"w3-third point\">\n                  <h2>Identity Management</h2>\n                  <p>This uses the latest cryptography to create the most comprehensive authentication protocols and \n                    run a full check on any developer added backdoors that may have been left open.</p>\n              </div>\n            </div>\n            <div class=\"w3-row\">\n                <div class=\"w3-third point\">\n                  <h2>Penetration Testing</h2>\n                  <p>Tests your system configuration, architecture, \n                    and even your system countermeasures to ensure that hackers cannot find their way in.</p>\n                </div>\n                <div class=\"w3-third point\">\n                  <h2>Ongoing Monitoring</h2>\n                  <p>We use industry standards such as BASEL II and \n                    SOX as a foundation for providing you with continual monitoring services you can trust.</p>\n                </div>\n                <div class=\"w3-third point\">\n                  <h2>Patch Management</h2>\n                  <p>Keeps all of your software up-to-date safely and \n                    quickly to make sure that vulnerabilities are never revealed.</p>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"aware\" style=\"background-image:url('assets/images/protect for computer security 7.jpg '); height: 500px; \">\n           \n            <p>The time to worry about security is before an attack, not after. \n              The safety of your data and your customer’s sensitive information should be your prime concern, \n              but it’s actually our business. ADM is a leading global security testing company, \n              and we can work with you to certify your site and give you and your clients the safety and \n              security they deserve.</p>\n        </div>\n\n    </div>\n\n</html>"

