"list-style-type:circle;\">\n                <li>Comprehensive test library</li>\n                <li>Defined scripting standard</li>\n                <li>Eliminate duplicate coding</li>\n            </ul> \n          </div>\n          <div class=\"w3-third\">\n            <ul style=\"list-style-type:circle;\">\n              <li>Reduce overhead</li>\n              <li>Limited test updates</li>\n              <li>Reusable scripts</li>\n            </ul> \n          </div>\n        </div>\n\n        <div class=\"w3-row  w3-teal content\">\n            <h1>Many Steps Along the Way</h1>\n            <div class=\"w3-half  inner\">   \n                <ul style=\"list-style-type:square;\">\n                    <li>The identification of necessary utility/components related to the application functionalities </li>\n                    <li>Types of input data store for data flow  </li>\n                    <li>Communication between the components </li>\n                    <li>Communication between environments </li>\n                    <li>Tool Extensibility  </li>\n                    <li>Determine the testing scope – enterprise, product, or project oriented </li>\n                    <li>Determine testing types – functional, requirements, performance </li>\n                    <li>Determine what can be automated and what cannot  </li>\n                    <li>Internal systems involved in the application process </li>\n                </ul> \n            </div> \n            <div class=\"w3-half inner\">\n                <ul style=\"list-style-type:square;\">\n                    <li>Business rules  </li>\n                    <li>Database validation needs </li>\n                    <li>Communication with other tools </li>\n                    <li>Data retrieval from any data storage  </li>\n                    <li>Functions that may be based on schedulers </li>\n                    <li>Logs for analysis </li>\n                    <li>Error handling  </li>\n                    <li>Custom application messages </li>\n                    <li>Testing approaches – record/replay, data driven, action/keyword, etc. </li>\n                </ul> \n            </div>\n        </div>\n\n        <div class=\"list\" style=\"background-image:url('assets/images/pexels-photo-220201.jpeg ');  \">\n            <h1>Widely Used Automation Tools:</h1>\n            <ul style=\"list-style-type:square;\">\n                <li>Quick Test Professional</li>\n                <li>TestComplete</li>\n                <li>Silk Test</li>\n                <li>Testing Anywhere</li>\n                <li>Selenium</li>\n            </ul> \n        </div>\n    </div>\n\n</html>"

